import React from 'react'
import './home.css';
import { Link } from "react-router-dom";

const cardNames = [
  {
    name: 'Students',
    path: '/students',
  },
  {
    name: 'Classrooms',
  },
  {
    name: 'Teachers',
  },
  {
    name: 'Classrooms',
  },
  {
    name: 'Sample',
  },
  {
    name: 'Sample',
  },
];
function home() {
  return (
    <div className="main">
       {cardNames.map((card, index) => (
      <div key={index} className="cardmain">
       <Link to={card.path}>
          <div  className="card">
            {/* Check if a path is specified for the card */}
            {card.path ? (
              
                <h1>{card.name}</h1>
              
            ) : (
              <h1>{card.name}</h1>
            )}
          </div>
          </Link>
        
      </div>
      ))}
    </div>
  );
}


export default home
